import React from "react";
import Card from "./Card";

const CardList = ({ robots }) => {
  const cardComponente = robots.map((user, i) => {
    return (
      <Card
        id={robots[i].id}
        nombre={robots[i].nombre}
        email={robots[i].email}
      />
    );
  });
  return (
    <div>
      <Card
        id={robots[0].id}
        nombre={robots[0].nombre}
        email={robots[0].email}
      />
      <Card
        id={robots[1].id}
        nombre={robots[1].nombre}
        email={robots[1].email}
      />
      <Card
        id={robots[2].id}
        nombre={robots[2].nombre}
        email={robots[2].email}
      />
    </div>
  );
};

export default CardList;
